export function Pagination({ currentPage, countCurrentPage }) {
  const pageNambers = [];
  for (let i = 1; i <= (currentPage / countCurrentPage); i++) {

    pageNambers.push(i);
  }

  return (
    <div>
      {pageNambers.map((elem) => (
        <div>{elem}</div>
      ))}
    </div>
  );
}
